import React from 'react';
import { FaUserCircle } from "react-icons/fa";
import {Link} from "react-router-dom";
import "./Navbar.css";
// import './logo.png';

const Navbar = () => {
  return (
        <nav className="navbar">
          <div className='nav-item'>
            <Link to='/' className='nav-link' id='logo'><img src="./logo.png" alt="logo"/></Link>
            <Link to='/' className="nav-link">Home</Link>
            <Link to='/movie' className="nav-link">Movies</Link>
            <Link to='/myfav' className="nav-link">My Fav</Link></div>
            
            <Link to='/user' className="nav-link"><FaUserCircle style={{width:'30px',height:'30px',marginRight:'10px'}}/></Link>
        </nav>    
  )
}

export default Navbar
